import React, { Component } from 'react';

class ReviewWrite extends Component {
	constructor() {
		super();
		this.state = {
			rating: 0,
			comment: ''
		};
	}

	render() {
		return (
			<div>
				<h2>Write Review</h2>
			</div>
		);
	}
}

export default ReviewWrite;
